import React from 'react'
import './movie.css'

const Card = ({ title, description, imageUrl }) => {

    const data = [
        {
            id : 1,
            img: "",
            title: "Defiance",
            desc: "One of the best scifi tv shows ever made"
        },
        {
            id : 2,
            img: "",
            title: "The Expanse",
            desc: "The best space opera ever made."
        },
        {
            id : 3,
            img: "",
            title: "Star Trek lower decks",
            desc: "A star trek movie"
        }

    ]


  return (
      <>
        {
            data.map(()=>{
                return(

                <div className="card">
                <div className="card-image">
                    <img src={imageUrl} alt="" />
                </div>
                <div className="card-text">
                    <h4 className="card-title">{title}</h4>
                    <p className="card-description">{description}</p>
                </div>
                </div>
                )
            })
        }  
      </>
  );
};

export default Card;
